@MielleOrganics by @exquisitemo has released its new collection, Oats & Honey!! This collection was designed to help relieve dry itchy scalp, dandruff & inflammation. It is great for ALL hair types.

This is their most gentle collection & is perfect if you have a sensitive scalp. However, anyone can use it, men & women, alike. You can purchase all the products as a bundle and receive a special surprise or you can purchase the items individually from the mielleorgaincs.com website.

#mielle #mielleorganics #mielleoatsandhoney #mtas
